        inputProps={{ 'aria-label': 'Without label' }}
      >
        <MenuItem disabled value="">
          <em>Placeholder</em>
        </MenuItem>
        {props.names.map((name) => (
          <MenuItem
            key={name}
            value={name}
            // style={getStyles(name, personName, theme)}
          >
            {name}
          </MenuItem>
        ))}
      </Select>
    );
};


CustomSelect.propTypes = {

};


export default CustomSelect;
